Instalación o configuración # Una vez que se extraen los archivos binarios, haga clic derecho en setup.exe y haga clic en &ldquo;Ejecutar como administrador&rdquo;
Aparecerá la ventana de arriba. Haga clic en Configuración de pruebas funcionales unificadas. Si aparece algún requisito previo, simplemente presione &ldquo;OK&rdquo; Espere a que el programa de instalación prepare la instalación. Después de unos minutos, haga clic en Siguiente
Acepte los términos del Acuerdo de licencia. En la pantalla Configuración personalizada, puede elegir qué complementos instalar.
